INSERT INTO public.paises_lideres (id_pais,n_pais,d_pais,id_capital,n_capital,d_capital,cargo,id_lider,n_lider,bio_lider,id_ciudad,n_ciudad,d_ciudad,id_pers,n_pers,fecha_nac,fecha_fallec,id_lugarfallec,tipo_lugarfallec,n_lugarfallec) VALUES ('http://dbpedia.org/resource/Chile','Chile','Chile (/ˈtʃɪli/; Spanish: [ˈtʃile]), officially the Republic of Chile (Spanish: ), is a South American country occupying a long, narrow strip of land between the Andes to the east and the Pacific Ocean to the west. It borders Peru to the north, Bolivia to the northeast, Argentina to the east, and the Drake Passage in the far south. Chilean territory includes the Pacific islands of Juan Fernández, Salas y Gómez, Desventuradas, and Easter Island in Oceania. Chile also claims about 1,250,000 square kilometres (480,000 sq mi) of Antarctica, although all claims are suspended under the Antarctic Treaty.','http://dbpedia.org/resource/Santiago','Santiago','Santiago (/ˌsæntiˈɑːɡoʊ/; Spanish pronunciation: [sanˈtjaɣo]), also known as Santiago de Chile [sanˈtjaɣo ðe ˈtʃile] , is the capital and largest city of Chile. It is also the center of its largest conurbation. Santiago is located in the country''s central valley, at an elevation of 520 m (1,706 ft) above mean sea level.','President of Chile','http://dbpedia.org/resource/Michelle_Bachelet','Michelle Bachelet','Verónica Michelle Bachelet Jeria (Spanish pronunciation: [beˈɾonika miˈtʃel βatʃeˈle ˈxeɾja]; born 29 September 1951) is a Chilean Socialist Party politician who has served as the President of Chile since 11 March 2014. She previously served as President from 2006 to 2010, becoming the first woman in her country to do so. After leaving the presidency and while not immediately re-electable, she was appointed the first executive director of the newly created United Nations Entity for Gender Equality and the Empowerment of Women (UN Women). In December 2013, Bachelet was re-elected as President of Chile with over 62% of the vote, bettering the 53.5% she obtained in 2006. She is the first person since 1932 to win the presidency of Chile twice in competitive elections.','http://dbpedia.org/resource/Santiago','Santiago','Santiago (/ˌsæntiˈɑːɡoʊ/; Spanish pronunciation: [sanˈtjaɣo]), also known as Santiago de Chile [sanˈtjaɣo ðe ˈtʃile] , is the capital and largest city of Chile. It is also the center of its largest conurbation. Santiago is located in the country''s central valley, at an elevation of 520 m (1,706 ft) above mean sea level.','http://dbpedia.org/resource/fulana','fulana','1869-08-29','1925-07-23','http://dbpedia.org/resource/Santiago','city','Santiago');
INSERT INTO public.paises_lideres (id_pais,n_pais,d_pais,id_capital,n_capital,d_capital,cargo,id_lider,n_lider,bio_lider,id_ciudad,n_ciudad,d_ciudad,id_pers,n_pers,fecha_nac,fecha_fallec,id_lugarfallec,tipo_lugarfallec,n_lugarfallec) VALUES ('http://dbpedia.org/resource/Benin','Benin','Benin (/bᵻˈniːn/ bǝ-NEEN or /bᵻˈnɪn/ bǝ-NIN; French: Bénin), officially the Republic of Benin (French: République du Bénin) and formerly Dahomey, is a country in West Africa. It is bordered by Togo to the west, Nigeria to the east, and Burkina Faso and Niger to the north. A majority of the population live on its small southern coastline on the Bight of Benin, part of the Gulf of Guinea in the northernmost tropical portion of the Atlantic Ocean. The capital of Benin is Porto-Novo, but the seat of government is in Cotonou, the country''s largest city and economic capital. Benin covers an area of 114,763 square kilometers and its population in 2015 was estimated to be approximately 10.88 million. Benin is a tropical, sub-Saharan nation, highly dependent on agriculture, with substantial employm','http://dbpedia.org/resource/Porto-Novo','Porto-Novo','Porto-Novo (also known as Hogbonu and Ajashe) is the capital of Benin, and was the capital of French Dahomey. The commune covers an area of 110 square kilometres (42 sq mi) and as of 2002 had a population of 223,552 people. It was originally developed as a port for the slave trade, an important part of many European Empires at the time including the Portuguese Empire.',NULL,NULL,NULL,NULL,'http://dbpedia.org/resource/Abomey','Abomey','Abomey is a city in the Zou Department of Benin. Abomey is also the former capital of the ancient Kingdom of Dahomey (c. 1600–1904), which would later become a French colony, then the Republic of Dahomey (1960–1975), and is the modern-day Republic of Benin. Abomey houses the Royal Palaces of Abomey, a collection of small traditional houses that were inhabited by the Kings of Dahomey from 1600 to 1900, and which were designated a World Heritage Site by UNESCO in 1985. The commune of Abomey covers an area of 142 square kilometres and as of 2012 had a population of 90,195 people.',NULL,NULL,'1917-01-16','2002-03-08','http://dbpedia.org/resource/Benin','country','Benin');
INSERT INTO public.paises_lideres (id_pais,n_pais,d_pais,id_capital,n_capital,d_capital,cargo,id_lider,n_lider,bio_lider,id_ciudad,n_ciudad,d_ciudad,id_pers,n_pers,fecha_nac,fecha_fallec,id_lugarfallec,tipo_lugarfallec,n_lugarfallec) VALUES ('http://dbpedia.org/resource/Chile','Chile','Chile (/ˈtʃɪli/; Spanish: [ˈtʃile]), officially the Republic of Chile (Spanish: ), is a South American country occupying a long, narrow strip of land between the Andes to the east and the Pacific Ocean to the west. It borders Peru to the north, Bolivia to the northeast, Argentina to the east, and the Drake Passage in the far south. Chilean territory includes the Pacific islands of Juan Fernández, Salas y Gómez, Desventuradas, and Easter Island in Oceania. Chile also claims about 1,250,000 square kilometres (480,000 sq mi) of Antarctica, although all claims are suspended under the Antarctic Treaty.','http://dbpedia.org/resource/Santiago','Santiago','Santiago (/ˌsæntiˈɑːɡoʊ/; Spanish pronunciation: [sanˈtjaɣo]), also known as Santiago de Chile [sanˈtjaɣo ðe ˈtʃile] , is the capital and largest city of Chile. It is also the center of its largest conurbation. Santiago is located in the country''s central valley, at an elevation of 520 m (1,706 ft) above mean sea level.','President of Chile','http://dbpedia.org/resource/Michelle_Bachelet','Michelle Bachelet','Verónica Michelle Bachelet Jeria (Spanish pronunciation: [beˈɾonika miˈtʃel βatʃeˈle ˈxeɾja]; born 29 September 1951) is a Chilean Socialist Party politician who has served as the President of Chile since 11 March 2014. She previously served as President from 2006 to 2010, becoming the first woman in her country to do so. After leaving the presidency and while not immediately re-electable, she was appointed the first executive director of the newly created United Nations Entity for Gender Equality and the Empowerment of Women (UN Women). In December 2013, Bachelet was re-elected as President of Chile with over 62% of the vote, bettering the 53.5% she obtained in 2006. She is the first person since 1932 to win the presidency of Chile twice in competitive elections.','http://dbpedia.org/resource/Santiago','Santiago','Santiago (/ˌsæntiˈɑːɡoʊ/; Spanish pronunciation: [sanˈtjaɣo]), also known as Santiago de Chile [sanˈtjaɣo ðe ˈtʃile] , is the capital and largest city of Chile. It is also the center of its largest conurbation. Santiago is located in the country''s central valley, at an elevation of 520 m (1,706 ft) above mean sea level.','http://dbpedia.org/resource/fulana','fulana','1869-08-29','1925-07-23','http://dbpedia.org/resource/Santiago','city','Santiago');
INSERT INTO public.paises_lideres (id_pais,n_pais,d_pais,id_capital,n_capital,d_capital,cargo,id_lider,n_lider,bio_lider,id_ciudad,n_ciudad,d_ciudad,id_pers,n_pers,fecha_nac,fecha_fallec,id_lugarfallec,tipo_lugarfallec,n_lugarfallec) VALUES ('http://dbpedia.org/resource/Brazil','Brazil','Brazil (/brəˈzɪl/; Portuguese: Brasil [bɾaˈziw]), officially the Federative Republic of Brazil (Portuguese: República Federativa do Brasil, ), is the largest country in both South America and Latin America. As the world''s fifth-largest country by both area and population, it is the largest country to have Portuguese as an official language–and the only one in the Americas. Bounded by the Atlantic Ocean on the east, Brazil has a coastline of 7,491 km (4,655 mi). It borders all other South American countries except Ecuador and Chile and covers 47.3% of the continent''s land area. Its Amazon River basin includes a vast tropical forest, home to diverse wildlife, a variety of ecological systems, and extensive natural resources spanning numerous protected habitats. This unique environmental herit','http://dbpedia.org/resource/Brasília','Brasília','Brasília (Portuguese pronunciation: [bɾaˈziljɐ]) is the federal capital of Brazil and seat of government of the Federal District. The city is atop the Brazilian highlands in the country''s center-western region. It was founded on April 21, 1960, to serve as the new national capital. Brasília and its metro (encompassing the Federal District) had a population of 2,556,149 in 2011, making it Brazil''s 4th most populous city. Among major Latin American cities, Brasília has the highest GDP per capita at R$61,915 (US$36,175).','President of Brazil','http://dbpedia.org/resource/Michel_Temer','Michel Temer','Michel Miguel Elias Temer Lulia (Portuguese pronunciation: [miˈʃɛw miˈɡɛw eˈliɐs ˈtẽmeɾ luˈliɐ]; born 23 September 1940) is a Brazilian lawyer and politician who is the 37th and current President of Brazil. He took office on 31 August 2016, after the impeachment and removal of his predecessor Dilma Rousseff, having served as Vice President since 2011 and as Acting President since 12 May 2016, when Rousseff was suspended from her presidential powers and duties to face her impeachment trial. At 75 years and 11 months old, he is the oldest person to assume the office.','http://dbpedia.org/resource/Rio_de_Janeiro','Rio de Janeiro','Rio de Janeiro (/ˈriːoʊ di ʒəˈnɛəroʊ, -deɪ ʒə-, -də dʒə-/; Portuguese pronunciation: [ˈʁi.u dʒi ʒɐˈnejɾu]; River of January), or simply Rio, is the second-most populous municipality in Brazil and the sixth-most populous in the Americas. The metropolis is anchor to the Rio de Janeiro metropolitan area, the second-most populous metropolitan area in Brazil and sixth-most populous in the Americas. Rio de Janeiro is the capital of the state of Rio de Janeiro, Brazil''s third-most populous state. Part of the city has been designated as a World Heritage Site, named "Rio de Janeiro: Carioca Landscapes between the Mountain and the Sea", by UNESCO on 1 July 2012 as a Cultural Landscape.','http://dbpedia.org/resource/fulana','fulana','1905-10-29',NULL,'http://dbpedia.org/resource/Rio_de_Janeiro',NULL,'Rio de Janeiro');
