ng the 53.5% she obtained in 2006. She is the first person since 1932 to win the presidency of Chile twice in competitive elections.','http://dbpedia.org/resource/Santiago','Santiago','Santiago (/ˌsæntiˈɑːɡoʊ/; Spanish pronunciation: [sanˈtjaɣo]), also known as Santiago de Chile [sanˈtjaɣo ðe ˈtʃile] , is the capital and largest city of Chile. It is also the center of its largest conurbation. Santiago is located in the country''s central valley, at an elevation of 520 m (1,706 ft) above mean sea level.','http://dbpedia.org/resource/mengano','mengano','1869-08-29','1925-07-23','http://dbpedia.org/resource/Santiago',NULL,'Santiago');
INSERT INTO public.paises_lideres (id_pais,n_pais,d_pais,id_capital,n_capital,d_capital,cargo,id_lider,n_lider,bio_lider,id_ciudad,n_ciudad,d_ciudad,id_pers,n_pers,fecha_nac,fecha_fallec,id_lugarfallec,tipo_lugarfallec,n_lugarfallec) VALUES ('http://dbpedia.org/resource/Brazil','Brazil','Brazil (/brəˈzɪl/; Portuguese: Brasil [bɾaˈziw]), officially the Federative Republic of Brazil (Portuguese: República Federativa do Brasil, ), is the largest country in both South America and Latin America. As the world''s fifth-largest country by both area and population, it is the largest country to have Portuguese as an official language–and the only one in the Americas. Bounded by the Atlantic Ocean on the east, Brazil has a coastline of 7,491 km (4,655 mi). It borders all other South American countries except Ecuador and Chile and covers 47.3% of the continent''s land area. Its Amazon River basin includes a vast tropical forest, home to diverse wildlife, a variety of ecological systems, and extensive natural resources spanning numerous protected habitats. This unique environmental herit','http://dbpedia.org/resource/Brasília','Brasília','Brasília (Portuguese pronunciation: [bɾaˈziljɐ]) is the federal capital of Brazil and seat of government of the Federal District. The city is atop the Brazilian highlands in the country''s center-western region. It was founded on April 21, 1960, to serve as the new national capital. Brasília and its metro (encompassing the Federal District) had a population of 2,556,149 in 2011, making it Brazil''s 4th most populous city. Among major Latin American cities, Brasília has the highest GDP per capita at R$61,915 (US$36,175).','President of Brazil','http://dbpedia.org/resource/Michel_Temer','Michel Temer','Michel Miguel Elias Temer Lulia (Portuguese pronunciation: [miˈʃɛw miˈɡɛw eˈliɐs ˈtẽmeɾ luˈliɐ]; born 23 September 1940) is a Brazilian lawyer and politician who is the 37th and current President of Brazil. He took office on 31 August 2016, after the impeachment and removal of his predecessor Dilma Rousseff, having served as Vice President since 2011 and as Acting President since 12 May 2016, when Rousseff was suspended from her presidential powers and duties to face her impeachment trial. At 75 years and 11 months old, he is the oldest person to assume the office.','http://dbpedia.org/resource/Rio_de_Janeiro','Rio de Janeiro','Rio de Janeiro (/ˈriːoʊ di ʒəˈnɛəroʊ, -deɪ ʒə-, -də dʒə-/; Portuguese pronunciation: [ˈʁi.u dʒi ʒɐˈnejɾu]; River of January), or simply Rio, is the second-most populous municipality in Brazil and the sixth-most populous in the Americas. The metropolis is anchor to the Rio de Janeiro metropolitan area, the second-most populous metropolitan area in Brazil and sixth-most populous in the Americas. Rio de Janeiro is the capital of the state of Rio de Janeiro, Brazil''s third-most populous state. Part of the city has been designated as a World Heritage Site, named "Rio de Janeiro: Carioca Landscapes between the Mountain and the Sea", by UNESCO on 1 July 2012 as a Cultural Landscape.',NULL,NULL,'1905-10-29',NULL,'http://dbpedia.org/resource/Rio_de_Janeiro',NULL,'Rio de Janeiro');
