he impeachment and removal of his predecessor Dilma Rousseff, having served as Vice President since 2011 and as Acting President since 12 May 2016, when Rousseff was suspended from her presidential powers and duties to face her impeachment trial. At 75 years and 11 months old, he is the oldest person to assume the office.','http://dbpedia.org/resource/Rio_de_Janeiro','Rio de Janeiro','Rio de Janeiro (/ˈriːoʊ di ʒəˈnɛəroʊ, -deɪ ʒə-, -də dʒə-/; Portuguese pronunciation: [ˈʁi.u dʒi ʒɐˈnejɾu]; River of January), or simply Rio, is the second-most populous municipality in Brazil and the sixth-most populous in the Americas. The metropolis is anchor to the Rio de Janeiro metropolitan area, the second-most populous metropolitan area in Brazil and sixth-most populous in the Americas. Rio de Janeiro is the capital of the state of Rio de Janeiro, Brazil''s third-most populous state. Part of the city has been designated as a World Heritage Site, named "Rio de Janeiro: Carioca Landscapes between the Mountain and the Sea", by UNESCO on 1 July 2012 as a Cultural Landscape.','http://dbpedia.org/resource/fulana','fulana','1905-10-29',NULL,NULL,'city',NULL);
